title: Volunteer - GenCyber Camp 2023
dates: July 23rd, 2023 - July 27th, 2023
description: Helped at Eastern Washington University's GenCyber Camp. GenCyber is a series of camps held around the country to help provide opportunities for students to learn about Cybersecurity. Helped high schoolers with various activites including learning basic linux, basic networking, and CTFs.
